import React from 'react';
import ReactDOM  from 'react-dom';
import { add,sub,mul,div}from './App';

ReactDOM.render(
  <>
    <ul>
      <li>sum of two no{add(30,5)}</li>
      <li>sub of two no {sub(30-5)}</li>
      <li>mul of two {30*2}</li>
      <li>div of two {30+2}</li>
    </ul>
  </>


  ,document.getElementById('root')
);
